import React from 'react'
import { Play } from '../Alies'

const KickOff: React.FC<{value:Play}> = ({value})  => {
    if (value.play_type==="Kick Off"){
        return (
            <div>
              {value.kicker} kicks {value.yards_gained}. {value.kick_result}
            </div>
          )
    }
  return null
}

export default KickOff
